import React from "react";
import Button from "@material-ui/core/Button";
import { makeStyles } from "@material-ui/core/styles";
import AddIcon from "@mui/icons-material/Add";

const useStyles = makeStyles({
  button: {
    height: "52px",
    width: "284px",
    borderRadius: "0px",
    padding: "14px, 24px, 14px, 24px",
  },
  addicon:{
    height: "20px",
          borderRadius: "nullpx",
          fontFamily: "Raleway",
          fontStyle: "normal",
          fontWeight: "normal",
          fontSize: "16px",
          lineHeight: "20px",
          textTransform: "initial",
          width: "auto",
          paddingLeft: "13px",
  }
});
interface Props {
  startIcon?: any;
  variant?: any;
  color?: any;
  children?: any;
  disabled?: boolean;
}

const Buttons: React.FunctionComponent<Props> = (props) => {
  const classes = useStyles();
  return (
    <div>
      <Button
        startIcon={props.startIcon}
        variant={props.variant}
        color={props.color}
        disabled={props.disabled}
      >
        {props.children}
      </Button>
    </div>
  );
};
const Buttons2: React.FunctionComponent<Props> = (props) => {
  const classes = useStyles();
  return (
    <div>
      <Button variant = "outlined" classNAme={classes.button} startIcon={<AddIcon variant="body1" className={classes.addicon}></AddIcon>}>Add To Library</Button>
    </div>
  );
};

export default Buttons;
